import { faB, faBlog, faHeart, faHome, faSave } from '@fortawesome/free-solid-svg-icons';
import { SideButton } from '../SideButton';

function RoutePage() {
    return (
        <div className="wrapper">
            <SideButton children={'Trang chủ'} icon={faHome} />
            <SideButton children={'Danh sách yêu thích'} icon={faHeart} />
            <SideButton children={'Blog'} icon={faBlog} />
        </div>
    );
}

export default RoutePage;
